import React, { Component } from 'react'
import Config from '../../Utils/Config';
import { withTranslation } from 'react-i18next';
import './index.scss';

export class ForgotPassword extends Component {
    render() {
        const { t } = this.props;
        return (
            <div>
                <div className="headbar">
                    <img src={Config.logoSm} alt={Config.siteTitle} className="s-50" />

                    <h3 className="mb-1">{t('page.forget_password.title')}</h3>
                    <p className="fs-xs">Just a step away to reset password</p>
                </div>
                <form action="#">
                    <div className="form-group mb-3">
                        <label className="label-sm" htmlFor="label--email">Your Email</label>
                        <input type="text" id="label--email" className="form-control" placeholder="Email"/>
                    </div>
                    <div className="button-area">
                        <button className="btn btn-primary btn-block">Send Reset Link</button>
                    </div>
                </form>

                <div className="other-links text-center mt-3">
                    <a href={Config.loginPageUrl}>Back to Login?</a>                  
                </div>
            </div>
        )
    }
}

export default withTranslation()(ForgotPassword)
